import React from 'react';
import cards from "./cards.json"

import Jumbotron from "./components/Jumbotron"
import Card from "./components/Card"

class App extends React.Component {
  state = {cards}



  render() {
    return (
      <div className="App">
        <Jumbotron />
        {cards.map(card => <Card></Card>)}
      </div>
    );
  }
}

export default App;
